import React, { Component } from 'react';
import App from "./Standard/App.js";
import Complex from "./Complex/App.js";

class ApplicationMenu extends Component {
    constructor(props){
        super(props);
        this.choice = this.choice.bind(this);
    }
    choice(){
        let value;
        switch(this.props.userChoice){
            case 1:
                value = <App />;
            break;
            case 2:
                value = <Complex />;
            break;
            default:
                value = <div>
                                <h1>Choose type of calculator</h1>
                                <ul>
                                    <li onClick={this.props.standard}> Standard </li>
                                    <li onClick={this.props.complex}> Complex Numvers </li>
                                </ul>
                            </div>;

            break;
        }
    }

    render(){
        this.choice();
        return(
            <div>
                {value}
            </div>
        )
    }


}

export default ApplicationMenu
